import React, {useState} from 'react';
import { Button } from 'react-native';

export default function List(props){
    const [items, setItems] = useState([]);

    let addItem = () => {
        setItems([...items,{
            id: items.length,
            value: 10.01
        }]);
    }

    return(
        <div>
            <Button onPress={addItem} title="Add a Number"/>
            <ul>                
                {items.map(item =>(
                    <li key={item.id}>{item.value}</li>
                ))}
                <li>Number of elements: {items.length}</li>
            </ul>
        </div>
    );
}
